member.summary:
Represents a dynamic search ad. This ad will have its headline and final URL auto-generated at serving time according to domain name specific information provided by DynamicSearchAdsSetting at the campaign level.
Auto-generated fields: headline and final URL.
Note: we recommend using the ExpandedDynamicSearchAd type, introduced in v201705, rather than the DynamicSearchAd type.
Required fields: description1, , displayUrl.
The tracking URL field must contain at least one of the following placeholder tags (URL parameters):
{unescapedlpurl}
{escapedlpurl}
{lpurl}
{lpurl+2}
{lpurl+3}
{unescapedlpurl} will be replaced with the full landing page URL of the displayed ad. Extra query parameters can be added to the end, e.g.: "{unescapedlpurl}?lang=en".
{escapedlpurl} will be replaced with the URL-encoded version of the full landing page URL. This makes it suitable for use as a query parameter value (e.g.: "http://www.3rdpartytracker.com/?lp={escapedlpurl}") but not at the beginning of the URL field.
{lpurl} encodes the "?" and "=" of the landing page URL making it suitable for use as a query parameter. If found at the beginning of the URL field, it is replaced by the {unescapedlpurl} value. E.g.: "http://tracking.com/redir.php?tracking=xyz&url={lpurl}".
{lpurl+2} and {lpurl+3} will be replaced with the landing page URL escaped two or three times, respectively. This makes it suitable if there is a chain of redirects in the tracking URL.
Note that finalUrls and cannot be set for dynamic search ads.
For more information, see the article Using dynamic tracking URLs. This is disabled for AdX when it is contained within Operators: ADD, SET.

Represents an ExpandedDynamicSearchAd. This ad will have its headline, final URLs and display URL auto-generated at serving time according to domain name specific information provided by DynamicSearchAdsSetting linked at the campaign level.
Auto-generated fields: headline, final URLs and display URL.
Required fields: description.
The tracking URL field must contain at least one of the following placeholder tags (URL parameters):
{unescapedlpurl}
{escapedlpurl}
{lpurl}
{lpurl+2}
{lpurl+3}
{unescapedlpurl} will be replaced with the full landing page URL of the displayed ad. Extra query parameters can be added to the end, e.g.: "{unescapedlpurl}?lang=en".
{escapedlpurl} will be replaced with the URL-encoded version of the full landing page URL. This makes it suitable for use as a query parameter value (e.g.: "http://www.3rdpartytracker.com/?lp={escapedlpurl}") but not at the beginning of the URL field.
{lpurl} encodes the "?" and "=" of the landing page URL making it suitable for use as a query parameter. If found at the beginning of the URL field, it is replaced by the {unescapedlpurl} value. E.g.: "http://tracking.com/redir.php?tracking=xyz&url={lpurl}".
{lpurl+2} and {lpurl+3} will be replaced with the landing page URL escaped two or three times, respectively. This makes it suitable if there is a chain of redirects in the tracking URL. This is enabled for AdX.

Represents a function where its operator is applied to its argument operands resulting in a return value. It has the form (Operand... Operator Operand...). The type of the return value depends on the operator being applied and the type of the operands.
Operands per function is limited to 20.
Here is a code example: // For example "feed_attribute == 30" can be represented as: FeedId feedId = (FeedId of Feed associated with feed_attribute) FeedAttributeId feedAttributeId = (FeedAttributeId of feed_attribute) Function function = new Function(); function.setLhsOperand( Arrays.asList((Operand) new FeedAttributeOperand(feedId, feedAttributeId))); function.setOperator(Operator.IN); function.setRhsOperand( Arrays.asList((Operand) new ConstantOperand(30L))); // Another example matching on multiple values: "feed_item_id IN (10, 20, 30)" can be represented as: Function function = new Function(); function.setLhsOperand( Arrays.asList((Operand) new RequestContextOperand(ContextType.FEED_ITEM_ID))); function.setOperator(Operator.IN); function.setRhsOperand(Arrays.asList( (Operand) new ConstantOperand(10L), new ConstantOperand(20L), new ConstantOperand(30L)));

Represents a criterion containing a function that when evaluated specifies how
            to target based on the type of the location. These "location groups" are custom,
            dynamic bundles of locations (for instance "High income areas in California" or
            "Airports in France"). 
Examples: For income demographic targeting, we
            need to specify the income tier and the geo which it targets. Areas in
            California that are in the top national income tier can be represented by: 
             Function function = new Function(); function.setLhsOperand(Arrays.asList(
            (Operand) new IncomeOperand(IncomeTier.TIER_1));
            function.setOperator(Operator.AND); function.setRhsOperand(Arrays.asList(
            (Operand) new GeoTargetOperand(Lists.newArrayList(new CriterionId(21137L))));
              For place of interest targeting, we need to specify the place of
            interest category and the geo which it targets. Airports in France can be
            represented by:   Function function = new Function();
            function.setLhsOperand(Arrays.asList( (Operand) new
            PlacesOfInterestOperand(PlacesOfInterestOperand.Category.AIRPORT));
            function.setOperator(Operator.AND); function.setRhsOperand(Arrays.asList(
            (Operand) new GeoTargetOperand(Lists.newArrayList(new CriterionId(2250L))));

NOTE: Places of interest and income targeting are read
            only. This is disabled for AdX when it
            is contained within Operators: ADD, SET.

Visitors of a page during specific dates. The visiting periods are defined as follows:
between startDate (inclusive) and endDate (inclusive);
before endDate (exclusive) with startDate = 2000-01-01;
after startDate (exclusive) with endDate = 2037-12-30.
